%[text] %[text:anchor:T_DD579E9A] # Slicer Femur Analysis 
%[text] In this script, we will load a Slicer Segmentation of the femur. We will then create and display a surface of this femur. And manipulate this surface in 3D space. So that it's long axis is aligned to the z-axis. We will then estimate the height of the femur using a bounding bounding. Finally we will capture the shaft of the femur and calculate its cross-sectional diameter.  
%[text] **Before getting started**: Load your Femur Segmentation and Measure the length  and diameter of the Femurs in Slicer
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] %[text:anchor:H_467406A6] ## Load Data
close all hidden
clearvars
setupMatGeom %[output:8004e948]
paths.project = "/Users/ernesto/MATLAB-Drive/MtMdata/unit3/Femur"; %[control:filebrowser:51e3]{"position":[17,66]}
ls(paths.project) % display folder contents %[output:7bb5b54f]
%%
paths.intensity = fullfile(paths.project,"6 BODY BONE cropped.nrrd");
paths.segment = fullfile(paths.project,"Salcedo Segmentation.seg.nrrd");
%[text] path check
table(fieldnames(paths),structfun(@(x) exist(x,"file"),paths),VariableNames=["path" "X"]) % make sure paths exist  %[output:4d3f1e1b]
%[text] - a zero in the table means the indicated file path does not exist  \
%%
%[text] ### Load the volumes as medical volumes
mvInt = medicalVolume(paths.intensity) %[text:anchor:TMP_7e79] %[output:330cce3c]
mVseg = medicalVolume(paths.segment) %[output:7d78dbca] %[output:8eb7ccb6]
%%
%[text] %[text:anchor:H_393065D7] ### Next load segmentation table
%[text] The segmentation metadata contains the segmentation names and properties that you set in 3D Slicer. We use the course function **mmGetSlicerSegTable** to read this metadata.
segT = mmGetSlicerSegTable(paths.segment) %[output:8b258835]
%[text] - Notice that in this segmentation volume, there are six different segmentations, labeled by the label values 1-6 \
%%
%[text] %[text:anchor:H_498901FE] ## Plot all Segmentations
%[text] We can plot all of the segmentations, using the **mmPlotAllSeg** function, which takes the following inputs:
%[text] - A segmentation volume — ***mv.Voxels*** (from the Medical Volume object)
%[text] - A segmentation table — ***segT*** (loaded using **mmGetSlicerSegTable**) \
mmPlotAllSeg(mVseg,segT,smooth=true,new_figure=true); %[output:1b3baa1d]
%[text] - my Segmentation contains the tibia, which we didn't segment in class.  \
%%
%[text] ### Calculate Volume and Mean Hounsfield Units
segCat = categorical(mVseg.Voxels,segT.LabelValue,segT.SegName);
rp = regionprops3(segCat,mvInt.Voxels,"Volume","MeanIntensity");
rp.IsBone = ~contains(rp.LabelName,"implant","IgnoreCase",true);
rp.VolumeCM3 = rp.Volume * prod(0.1*mVseg.VoxelSpacing) % convert to cm^3 %[output:26f88790]
%[text] - Hounsfield units are correlated to Bone Density
%[text] - Often cm are used instead of mm \
%%
%[text] ## Femur length
%[text] So, how long is the femur? Femur length accounts for approximately 26% of a person's height
%[text] Femurs are often measured in a bone box as shown in this image.
%[text] ![](text:image:5f58)
%[text] ### 
%[text] So, to measure femur length, we should first align the long axis of the femur to the cardinal axes and the measure the range of the vertices.
%%
%[text] ### Measure the Right Femur
%[text] The right femur doesn't have the implant. Let's measure that femur, first. 
%[text] We can pull out a single segmentation using the **mmGetMedicalVolumeSegment** function.
%[text] - Select the right femur segmentation when prompted. \
rSeg = mmGetMedicalVolumeSegment(mVseg,segT) %[output:0b0acc20]
%%
%[text] %[text:anchor:H_792696C4] ### Plot mask
%[text] We can plot the femur using the **mmPlotMask2Surface** function
tform = intrinsicToWorldMapping(mVseg.VolumeGeometry); % get the transformation matrix (mm space, correct orientation)

rSeg.hp = mmPlotMask2Surface(rSeg.mask, ... %[output:group:5bbfbeb7] %[output:5a8b4b9f]
    fcolor=rSeg.color, ... %[output:5a8b4b9f]
    falpha=0.75, ... %[output:5a8b4b9f]
    smooth=true, ... %[output:5a8b4b9f]
    affTrfm=rSeg.tform.A, ... % transform the surface (to mm space) %[output:5a8b4b9f]
    new_figure=true); %[output:group:5bbfbeb7] %[output:5a8b4b9f]
%[text] - note the use of the color from the segmentation table
%[text] - Since we transformed the model using `tform`, our axes are in mm. \
%%
%[text] Once we have plotted the surface, we have access to the Vertices and the Faces in the patch handle, ***hp***:
rSeg.hp
%[text] - this Patch handle contains the Vertices and Faces from the object.
%[text] - If you close the figure, patch handle is deleted (and you no longer have access to the Vertices and Faces)
%[text] - So, don't close the figure while you are performing your mesh analysis... \
%%
%[text] %[text:anchor:H_E096F736] ### Realign Femur
%[text] The femur is nicely aligned already, but can we do better?
%[text] %[text:anchor:H_2CBF4C6D] #### Recenter to 0,0,0
rSeg.hp.Vertices = rSeg.hp.Vertices - mean(rSeg.hp.Vertices); %[output:7f7853c7]
%[text] - Whenever doing alignment, you should center the surface to 0,0,0 to make the alignment process easier \
%%
%[text] %[text:anchor:H_2715DC2C] #### Align long axis of the femur to cardinal axes
%[text] The function **mmAlign2Surface** analyzes the vertices in the surface and establishes a long axis in these vertices. Then, it aligns the long axes of the surface to the x-axis
rSeg.hp.Vertices = mmAlignSurface2Axes(rSeg.hp.Vertices); %[output:2e0e5bd4]
%[text] - notice that the Femur is lying nicely flat on the xy plane \
%%
%[text] %[text:anchor:H_95D4E618] #### Rotate Surface
%[text] - to match the picture above, we will rotate the femur 90º (this is not strictly necessary) \
rSeg.hp.Vertices = mmRotateSurfaceVertices(rSeg.hp.Vertices,'y',-90); %[output:7b8c8aa7]
%%
%[text] Now that we have aligned the femur nicely aligned to the z-axis, we simply need to calculate the range of the z-vertices
rSeg.length = range(rSeg.hp.Vertices(:,3)) %[output:623dec47]
%[text] - We a value which is fairly close to what we measured in Slicer
%[text] - Note, the length is already in mm, because we transformed the femur when we plotted it \
%%
%[text] %[text:anchor:H_5444A232] ### Femur length is often used as an estimate for height.
%[text] Many studies have used linear regression to estimate an individual's from the femur length. 
%[text] The following is one such formula, based on this article:
%[text] [https://www.sciencedirect.com/science/article/abs/pii/S1344622316300141?via%3Dihub](https://www.sciencedirect.com/science/article/abs/pii/S1344622316300141?via%3Dihub) 
%[text] ```
%[text] Male body height (cm) = (F1 * 2.38 + 614.1) /10
%[text] Female body height (cm) = (F1 * 2.47 + 541.0) /10
%[text] ```
%[text] Calculate height in cm
rSeg.heightCM = (rSeg.length * 2.47 + 541.0)/10 %[output:876ed3a5]
%%
%[text] Convert to feet and report in American
rSeg.heightFT = rSeg.heightCM/2.54/12 %[output:4624c28b]
fprintf('Estimated height is %d foot %1.2f inches', floor(rSeg.heightFT), (rSeg.heightFT-floor(rSeg.heightFT))*12) %[output:63f05a8c]
%[text] - note, this works because we aligned the femur to the orthogonal axes.  \
%%
%[text] %[text:anchor:H_AC8D619F] ### Estimate Shaft Diameter
%[text] The femur is the thickest bone in the body. How would you estimate the diameter of the shaft? We could use the approach we used with the Aorta; however, we have to deal with the femur head and the condyles. Let's review the un-transformed surfaces (which will best match the indices in the volume).
figure %[output:689211a3]
mmPlotMask2Surface(rSeg.mask,fcolor='c',falpha=0.25); % not transformed %[output:689211a3]
%[text] - luckily, our femur is well aligned to the z-axis, so we can easily crop out a section of the volume
%[text] - looks like anything between 500 and 800 on z-axis should be representative of the shaft \
%%
rSeg.maskCrop = rSeg.mask(:,:,500:800);

rSeg.edt = bwdist(~rSeg.maskCrop); % Euclidean Distance Transform of cropped volume
rSeg.skel = bwskel(rSeg.maskCrop,MinBranchLength=20); % skeletonize

figure; %[output:20bb5adc]
tiledlayout("horizontal") %[output:20bb5adc]
nexttile %[output:20bb5adc]
mmPlotMask2Surface(rSeg.maskCrop,fcolor='c',falpha=0.1); %[output:20bb5adc]
mmPlotMask2Surface(rSeg.skel,fcolor='m',falpha=1); %[output:20bb5adc]
%[text] - works great \
%%
rSeg.Radii = rSeg.edt(rSeg.skel) * rSeg.spacing(1) ; % get radii and convert to mm
rSeg.diameter = mean(rSeg.Radii)*2; 

nexttile %[output:15c46865]
plot(rSeg.Radii) % plot  radius along length %[output:15c46865]
ylabel("Radius (mm)") %[output:15c46865]
xlabel("Extent (along z-axis)") %[output:15c46865]
title(sprintf('Mean Diameter = %1.2f mm',rSeg.diameter)) %[output:15c46865]
%[text] 
%%
%[text] %[text:anchor:H_B503056F] ### Measure Length of Left Femur
%[text] How would we measure the length of the left femur? Since we cropped the femur at the level of the implant, we need both the femur and the implant.
lSeg = mmGetMedicalVolumeSegment(mVseg,segT) % select left femur %[output:13865507]
%%
tSeg = mmGetMedicalVolumeSegment(mVseg,segT) % select implant %[output:0908bb5a]
%%
lSeg.maskCombo = lSeg.mask | tSeg.mask; % combine femur and implant into one mask

lSeg.hp = mmPlotMask2Surface(lSeg.maskCombo, fcolor='g', ... %[output:group:804a36e2] %[output:296641bd]
    falpha=1, ... %[output:296641bd]
    affTrfm=rSeg.tform.A, ... % transform the surface (to mm space) %[output:296641bd]
    new_figure=true); %[output:group:804a36e2] %[output:296641bd]
%%
lSeg.hp.Vertices = lSeg.hp.Vertices - mean(lSeg.hp.Vertices); % center to 0,0,0 %[output:8fef317d]
lSeg.hp.Vertices = mmAlignSurface2Axes(lSeg.hp.Vertices); % align to xy plane %[output:8fef317d]
lSeg.hp.Vertices = mmRotateSurfaceVertices(lSeg.hp.Vertices,'y',90); % rotate %[output:8fef317d]
%%
lSeg.length = range(lSeg.hp.Vertices(:,3)) %[output:855defdb]
rSeg.length %[output:2b697907]
%[text] - pretty close to right length! (about a mm difference) \
%[text] ## 

